import React from 'react';
import Head from 'next/head'
import { makeStyles } from '@material-ui/core/styles';
import * as link from '../../utilities/link-config';

const useStyles = makeStyles((theme) => ({}));

function BlogPost({ post }) {

    console.log(post)

    const classes = useStyles();
    return (
        <div className={classes.root}>
            <Head>
                <title>nanocosmos Blogpost</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>
            This is a blogpost
        </div>
    )
}

export async function getStaticPaths() {
    const res = await fetch(`${link.STRAPI_URL}/articles`);
    const posts = await res.json();
    // const paths = posts.map((post) => `${link.STRAPI_URL}/articles/${post.id}`)
    console.log("PATHS", posts)
    return {
        paths: [
            { params: { id: '1' } },
            { params: { id: '2' } }
        ], fallback: false
    }
}

export async function getStaticProps({ params }) {
    console.log("PARAMS", params)
    const res = await fetch(`${link.STRAPI_URL}/articles/${params.id}`)
    const post = await res.json()
    return {
        props: {
            post
        }
    }
}

export default BlogPost;
